import React, { useEffect, useState } from "react";
import axios from "axios";
export default function FormSubmissions() {
  const [forms, setForms] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:5000/forms/getFields").then((res) => {
      // console.log(res);

      setForms(res.data);
    });
    //console.log(forms);

    //console.log(forms);
  }, []);

  useEffect(() => {
    console.log(forms);

    //console.log(forms);
  }, [forms]);

  return (
    <div>
      <table>
        <tr
          style={{
            padding: "7px",
            align: " left",
          }}
        >
          <td
            style={{
              padding: "7px",
              align: " left",
              borderBottom: "1px solid #ddd",
              borderTop: "1px solid #ddd",
            }}
          >
            field label
          </td>
          <td
            style={{
              padding: "7px",
              align: " left",
              borderBottom: "1px solid #ddd",
              borderTop: "1px solid #ddd",
            }}
          >
            {" "}
            input name
          </td>
          <td
            style={{
              padding: "7px",
              align: " left",
              borderBottom: "1px solid #ddd",
              borderTop: "1px solid #ddd",
            }}
          >
            input type
          </td>

          <td
            style={{
              padding: "7px",
              align: " left",
              borderBottom: "1px solid #ddd",
              borderTop: "1px solid #ddd",
            }}
          >
            input value
          </td>
        </tr>
      </table>
      {forms.map((form) => {
        return (
          <table>
            <tr
              style={{
                padding: "30px",
                align: " left",
                borderBottom: "1px solid #ddd",
              }}
            >
              <td
                style={{
                  padding: "30px",
                  align: " left",
                  borderBottom: "1px solid #ddd",
                }}
              >
                {form.fieldLabel}
              </td>
              <td
                style={{
                  padding: "30px",
                  align: " left",
                  borderBottom: "1px solid #ddd",
                }}
              >
                {form.inputName}
              </td>
              <td
                style={{
                  padding: "30px",
                  align: " left",
                  borderBottom: "1px solid #ddd",
                }}
              >
                {" "}
                {form.inputType}
              </td>
              <td
                style={{
                  padding: "30px",
                  align: " left",
                  borderBottom: "1px solid #ddd",
                }}
              >
                {" "}
                {form.inputVal}
              </td>
            </tr>
          </table>
        );
      })}
    </div>
  );
}
